import "./Category.scss";
import cat1 from "../../../assets/category/cat-1.jpg";
const Category = ({categories}) => {
    return (<div className="shop-by-category">
        <div className="categories">
            <div className="category">
            <img src={cat1} alt="" />
            </div>

        </div>
    </div>);
};

export default Category;
